filmed at Cuernavaca, Morelos, Mexico

A bank robber's avarice and obsessive quest for freedom lead to his downfall in this adventure packed crime drama that was shot on location in Mexico. After lifting a cool million dollars from a U.S. bank, the crook is anxious to sneak across the border into Mexico, but to do so he must hire an experienced wilderness guide. When things don't go as planned, the crook forces the guide and his wife into the mountains with him.


